INSERT INTO `si_team` (`id`, `nombre`, `puesto`, `descripcion`, `familia_cert`) VALUES
(1, 'YENNY GEORGINA CHAN UICAB', 'AUXILIAR DE COBRANZA', 'SOY UNA PERSONA AMABLE Y AMIGABLE, ME ENCANTA HACER REIR A LAS PERSONAS Y CONOCER GENTE NUEVA.', 'Me enorgullece ser parte de un crecimiento constante y formar parte de una universidad con renombre.\n'),
(2, 'JOSE JESUS RIVERO VAZQUEZ', 'COORDINADOR DE TERCER AÑO ENFERMERIA Y DEL PRIMER AÑO GRUPO C DE MEDICINA', 'RESPONSABLE Y COMPROMETIDO CON EL TRABAJO', 'Algo que valoro mucho del CERT es el buen ambiente y el trabajo en equipo. '),
(3, 'JOSUE DANIEL SERRANO SANTIAGO', 'ASESOR DE CONTROL ESCOLAR', 'Me considero una persona responsable, dinámica y creativa siempre con la iniciativa de resolver problemas y ayudar siempre a quien lo necesite. Amo muchísimo mi trabajo. Soy una persona que le encanta aprender, crecer y trabajar para lograr mis metas. Inspirado siempre de la gente que me rodea. ', 'Me gusta desarrollarme en un buen ambiente laboral donde hay trabajo en equipo. En el CERT formas parte de una gran familia de profesionales que te motivan a crecer y dar lo mejor de ti.'),
(4, 'GABRIELA ALEJANDRA VELA GUTIÉRREZ', 'ASESORA DE CONTROL ESCOLAR', 'RESPONSABLE, HUMILDE, AMABLE', 'Valoro mucho el trato que tengo con los alumnos y padres de familia. Esto me permite conocerlos mejor. '),
(5, 'CARLOS TUN JUÁREZ', 'Responsable del área de compras', 'Me considero una persona responsable, dinámica y creativa siempre con la iniciativa de resolver problemas y ayudar siempre a quien lo necesite. Amo muchísimo mi trabajo. Soy una persona que le encanta aprender, crecer y trabajar para lograr mis metas. Inspirado siempre de la gente que me rodea. Soy una persona responsable', 'El ambiente laboral es lo que más me gusta del CERT. Cada día de trabajo es como una reunión de amigos. '),
(6, 'Angel Antonio Rojas Collí', 'Asesor de control escolar', 'Soy una persona comprometida con lo que hago, alegre, dinámico y trabajador. Buscar siempre alternativas para resolver problemas', 'El compañerismo y la actitud de todo el personal es lo que más me gusta del CERT. El ambiente laboral es sumamente agradable y se apoya el crecimiento profesional de quienes trabajamos aquí.\n'),
(7, 'Everth Oscar Dzib Peraza', 'Director de Finanzas y Comunicación Institucional ', 'Soy el menor de 4 hermanos. Me encantan los deportes, en especial Tenis y Padel. Creo que una de las cosas mas importantes de la vida es buscar un balance en cada una de sus áreas. Trabajo por mis sueños y los de las personas que me rodean mientras intento cada vez mas disfrutar el proceso. Firme creyente que la educación y el deporte son el combo ideal para salir adelante como persona, miembro de una comunidad.', 'Me encanta formar parte de una institución que se fundó en Ticul, tierra que me vio nacer y crecer. De igual forma, me gusta seguir el legado del fundador y su equipo, que a partir de 1993 fueron sumando valores que, gratamente, pude experimentar en primera línea. Más allá del trabajo, me encanta colaborar con todo el equipo CERT, donde nuestras acciones van reflejando una mejora institucional continua.'),
(8, 'Guadalupe del Rubí Be Narváez ', 'Asesor de Control Escolar ', 'Me considero una persona responsable y dedicada en cada aspecto de mi vida tanto personal como profesional.', 'Amo mi trabajo, la calidez humana de los compañeros y el trabajo en equipo que siempre desempeñamos para sacar adelante cada trámite, evento o procedimiento.'),
(9, 'JORGE EDGARDO BAAS DURÁN', 'COORDINADOR DE INGRESOS', 'ME GUSTA EL TRABAJO EN EQUIPO, SIEMPRE DISPUESTO A COLABORAR Y A APOYAR PARA EL CRECIMIENTO DE LA INSTITUCIÓN.', 'La oportunidad de crecimiento laboral y profesional es algo que he encontrado en el CERT y que aprecio mucho. '),
(10, 'Zaira Valeria Maza Morillo', 'Supervisora de Servicio Social CERT Campus Mérida', 'Soy una persona motivadora, empática, y me gusta desempeñarme al máximo en mi trabajo.', 'Más que un equipo de trabajo somos una gran familia. El CERT es nuestro segundo hogar.'),
(11, 'MARIA JOSE GUTIERREZ PALMA', 'COORDINADORA ADMINISTRATIVA', 'SOY UNA PERSONA COMPROMETIDA, RESPONSABLE Y CON LA CAMISETA BIEN PUESTA', 'En el CERT he podido crecer personal y profesionalmente. Mi trabajo es valorado. Tengo un gran equipo de trabajo y los directores toman en cuenta nuestras opiniones.'),
(12, 'LOURDES LETICIA GONGORA CHAN', 'COORDINADORA DE EGRESOS CAMPUS MERIDA', 'SOY UNA PERSONA QUE LE GUSTA APRENDER Y SUPERARSE DÍA A DÍA, Y PONERLO A PRACTICA EN MI TRABAJO. ', 'Lo que más me gusta del CERT es el apoyo laboral, el aprender del trabajo y la oportunidad de crecimiento profesional y personal.'),
(13, 'Rosi Guadalupe Interian Soberanis', 'Administradora de pagos', 'Me considero una persona alegre, responsable y capaz de seguir aprendiendo cosas nuevas.', 'El aprendizaje día a día y el crecimiento personal y laboral es algo que siempre he tenido en esta institución.'),
(14, 'Juan Carlos Lara Moreno', 'Coordinador de campo clínico y servicio social', 'Soy licenciado en enfermería con Especialidades en cuidados intensivos, geronto geriatría y gestión y docencia hospitalaria, he dado clases cómo profesor titular tanto a nivel licenciatura como en especialidades y diversos diplomados cuento como una maestría en innovación y desarrollo educativo.', 'El compromiso, la lealtad, la calidad que se tiene en cada uno de los procesos, el sentido humano de los directivos, sus profesores. Eso y muchas cosas más son los grandes pilares del CERT.'),
(15, 'DANIEL UICAB AYALA ', 'ING. SISTEMAS COMPUTACIONALES', 'PERSONA ALEGRE Y AMIGABLE.', 'Me gusta mucho la amistad y compañerismo que existe entre los que forman parte de la familia CERT. '),
(16, 'PASCUAL JESUS NOH EK', 'MANTENIMIENTO', 'PERSONA SERIA Y RESPONSABLE', 'La convivencia entre los que formamos parte de la familia CERT me motiva todos los días a dar lo mejor de mí. '),
(17, 'JOSE EDUARDO CANUL CANCHE', 'MANTENIMIENTO', 'PERSONA TRANQUILA, HONESTO Y RESPONSABLE', 'Me gusta mucho el compañerismo y la convivencia con las personas que trabajo. \n'),
(18, 'YESENIA CALZADA AGUAYO', 'RESPONSABLE DE COBRANZA', 'SOY UNA PERSONA RESPONSABLE, AMIGABLE Y SINCERA', 'Trabajando en el CERT puedo decir que cada día aprendo algo nuevo. '),
(19, 'DELHY JIMENEZ NARVAEZ', 'AUXILIAR DE COBRANZA', 'ME CONSIDERO UN APERSONA SERVICIAL, ESCUCHO TODO TIPO DE MUSICA Y ME GUSTA HACER AMIGOS.', 'En mi departamento tenemos un muy buen ambiente de trabajo y nos brindamos mucho apoyo entre todos. Además siempre hay algo que aprender. \n'),
(20, 'WILBERTH HUMBERTO CAB NAHUAT', 'MANTENIMIENTO', 'PERSONA SERIA, RESPONSABLE Y ALEGRE EN EL TRABAJO', 'Hay muy buen compañerismo entre todos los departamentos, desde los directos hasta los alumnos y maestros. '),
(21, 'David Ivan Dzul Novelo ', 'Asesor de Admisiones', 'Soy una persona sencilla que le gusta ayudar y tiene la habilidad de poder activar el potencial de los demás, así como poder ayudar a hacerse mejores preguntas y enfocarse a algo que realmente les importa permitiendo un mejor desempeño. Porque cada persona tiene algo importante que aportar solo se trata de creer y dejarse ver. ', 'Lo que más me gusta de mi trabajo es poder orientar a otras personas en su formación profesional ,así como el apoyo que se brinda por parte de todo el personal para poder lograr cada objetivo propuesto. El compañerismo y el profesionalismo que se le pone a cada situación que se presenta. Es muy grato poder laborar en una institución donde puedes desarrollarte profesional y personalmente.'),
(22, 'Efraín Vazquez Uicab', 'Intendente área de jardines ', 'Me gusta leer y hacer deporte.', 'El compañerismo y el apoyo de todos cuando se necesita es algo que valoro mucho en mi trabajo en el CERT.'),
(23, 'Nelson Orlando Cárdenas Pech', 'Mantenimiento', 'Soy alegre, respetuoso, empático y activo.', 'El ambiente laboral en la familia CERT es lo que más me gusta de mi trabajo.'),
(24, 'NAIBY MAGDALENA CHAN EK', 'AUXILIAR DE COBRANZA', 'ME CONSIDERO UNA PERSONA AMABLE Y EFICIENTE.', 'Hay muy buena relación entre todos los departamentos lo que genera un buen ambiente laboral.'),
(25, 'Arturo de Jesús Solís Moo', 'Asesor de admisiones', 'Soy una persona humilde y padre de familia, me gusta relacionarme con las personas, el poder ayudar a los que más lo necesitan y sobre todo realizar con mucho entusiasmo mi trabajo.', 'Me gusta mucho la visión que tiene el CERT para ser una institución más competitiva, la innovación para seguir construyendo mejores espacios para sus alumnos, la convivencia con los integrantes de otros departamentos y pertenecer a una organización que se preocupa por la sociedad y el medio ambiente.'),
(26, 'Gilberth Emmanuel Cabrera Carrillo', 'Asesor de práctica clínicas y personalizadas', 'Soy muy alegre, amigable y tímido a la vez, me gusta escuchar a la gente y tener muchos amigos.', 'El compañerismo, el contacto con la gente, el poder desarrollarme profesionalmente, todo eso me hace apreciar mi trabajo en el CERT.'),
(27, 'Guadalupe del Carmen Arellano Ramón', 'Apoyo en la coordinación de enfermería', 'Me considero una persona responsable, disciplinada y comprometida con mi trabajo', 'En el CERT somos una familia. Todos trabajamos para hacer crecer nuestra institución y tenemos bien puesta la camiseta.'),
(28, 'LESLIE ABIGAIL VILLANUEVA ACOSTA', 'PERSONAL ADMINISTRATIVO DE POSGRADOS', 'ME GUSTA MUCHO LO QUE HAGO', 'Me gusta que en el CERT día a día voy aprendiendo actividades nuevas que me ayudan en mi formación profesional. '),
(29, 'Manuel Jesús Aldana Nic', 'Asesor de control escolar', 'Me gusta la lectura, la música, cantar y disfrutar a mi familia', 'La empatía, solidaridad y el clima laboral que se respira en el CERT es de las cosas que más me gustan.'),
(30, 'XIMENA ALEJANDRA POETA TELLO', 'ASESORA DE CONTROL ESCOLAR', 'SOY UNA PERSONA PROACTIVA, RESPONSABLE Y MUY ALEGRE, CON GANAS DE SUPERARME DIA CON DIA.', 'En el CERT tengo la oportunidad de crecer profesionalmente y además cuento con un muy buen ambiente laboral.'),
(31, 'Saulo Novelo Zel', 'Diseñador Gráfico y Multimedia', 'Soy originario de Hunucmá, apasionado por la fotografía en todos sus aspectos y me gusta mucho el arte y la música sobretodo el cómo puede hacer conectar a las personas y lo que nos hace sentir. Me mueve mucho la creatividad y siempre he pensado que nuestro trabajo como creativos es encontrar soluciones a cualquier problema. La creatividad es algo que siempre tenemos que poner por delante todo, absolutamente todo ha sido creado o concebido en base a ella y es algo que nos debe de acompañar en cada decisión que tomamos ya que es la que nos hace crecer como seres humanos y como personas.', 'Ser parte de la familia CERT es permitirte desarrollarte y crecer, es poder explotar todas las ideas que tengas y saber que cuentas con colaboradores que te respaldan y que te apoyan.'),
(32, 'Sebastián Alfonso Canul Burgos', 'Encargado de admisiones Posgrados CERT', 'Soy una persona persistente, alegre, capaz, dinámico y competitivo siempre con el fin de llegar a metas en común.', 'Tener un equipo de trabajo comprometido y compañeros de primera, es lo que más me gusta del CERT. \r\n'),
(33, 'Giselle Alejandra Chin May', 'Apoyo en la coordinación de la licenciatura en enfermería ', 'Me gusta mucho leer', 'En el CERT me siento a gusto y feliz de pertenecer porque ha sido y sigue siendo mi casa de estudios de la cual me siento muy orgullosa de formar parte.'),
(34, 'Sara Concepción Sosa Cob', 'Auxiliar de Cobranza', 'Me considero una persona responsabel, puntual y muy empática.', 'El ambiente laboral, el horario y la ubicación del plantel son cosas importantes para mí y en el CERT siempre las encuentro.'),
(35, 'Alondra Steffany Domínguez Montero', 'Asesor de admisiones', 'Soy una persona a la que le encanta platicar y convivir con las personas.', 'La calidez de las personas que colaboran en el CERT ayudan a formar este gran equipo.');
