INSERT INTO `tv_areas` (`id`, `nombre`, `descripcion`, `explicacion`, `profesiones`) VALUES
(1, 'SERVICIO SOCIAL (SS)', 'Habilidad para comprender problemas humanos, para tratar personas, cooperar y persuadir; para hacer lo más adecuado ante situaciones sociales. Actitud de ayuda afectuosa y desinteresada hacia sus semejantes.', 'Preferencia por participar en actividades directamente relacionadas con el bienestar de las personas.', 'Urbanismo, Ingeniería Civil, Sociología, Trabajo Social, Derecho, Enfermería y Obstetricia, Psicología, Pedagogía, Medicina, Odontología, Ciencias Políticas y Administración Pública, Economía, Relaciones Internacionales, Enseñanza de Inglés, Optometría, Planificación para el Desarrollo Agropecuario, Estudios Latinoamericanos, Bibliotecología y Estudios de la Información, Educación Musical.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Derecho, Licenciatura en Enfermería, Licenciatura en Psicología, Licenciatura en Educación Primaria, Licenciatura en educación Preescolar, Licenciatura en Médico Cirujano y Licenciatura en Administración y Mercadotecnia, '),
(2, 'EJECUTIVO PERSUASIVA (EP)', 'Capacidad para organizar, dirigir y supervisar a otros adecuadamente; poseer iniciativa, confianza en sí mismo, ambición de progreso, habilidad para dominar en situaciones sociales y en relaciones de persona a persona.', 'Agrado por planear, organizar o dirigir las actividades de personas o agrupaciones.', 'Actuaría, Economía, Administración, Ciencias Políticas y  Administración Pública, Derecho, Ingeniería Industrial, Ingeniería de Alimentos, Ingeniería Petrolera, Psicología, Medicina, Relaciones Internacionales.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Psicología, Licenciatura en Administración y Mercadotecnia, Licenciatura en Derecho, Licenciatura en Médico Cirujano,  Licenciatura en Educación Primaria y Licenciatura en Educación Preescolar.'),
(3, 'VERBAL (V)', 'Habilidad para comprender y expresarse correctamente. También para utilizar las palabras precisas y adecuadas.', 'Gusto por la lectura de obras diversas y	satisfacción al expresarse verbalmente o por escrito.', 'Derecho, Ciencias de la Comunicación, Letras Clásicas, Lengua	y Literaturas Modernas, Relaciones Internacionales, Literatura Dramática y Teatro, Sociología, Ciencias Políticas y Administración Pública.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Derecho, Licenciatura en Educación Primaria, Licenciatura en Educación Preescolar, Licenciatura en Administración y Mercadotecnia, Licenciatura en Nutrición, Licenciatura en Enfermería y Licenciatura en Fisioterapia.'),
(4, 'ARTÍSTICO PLÁSTICA (AP)', 'Habilidad para apreciar las formas o colores de un objeto, dibujo, escultura o pintura y para crear obras de mérito artístico en pintura, escultura, grabado o dibujo.', 'Agrado por conocer o realizar actividades creativas como dibujo, pintura, escultura, modelado, etcétera.', 'Artes Visuales, Diseño y Comunicación Visual, Diseño Gráfico, Arquitectura, Arquitectura de Paisaje, Odontología, Literatura Dramática y Teatro.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Educación Preescolar y  Licenciatura en Educación Primaria.'),
(5, 'MUSICAL (MS)', 'Habilidad para captar y distinguir sonidos en sus diversas modalidades, para imaginar estos sonidos, reproducirlos o utilizarlos en forma creativa; sensibilidad a la combinación y armonía de sonidos.', 'Gusto por la ejecución, estudio o composición de la música.', 'Composición, Instrumentista, Canto, Etnomusicología, Piano, Educación Musical.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Educación Primaria y Licenciatura en Educación Preescolar.'),
(6, 'ORGANIZACIÓN (OG)', 'Capacidad de organización, orden, exactitud y rapidez en el manejo de nombres, números, documentos, sistemas y sus detalles en trabajos rutinarios.', 'Preferencia por actividades que requieran orden y sistematización.', 'Bibliotecología y Estudios de la Información, Actuaría, Matemáticas Aplicadas y Computación, Informática, Contaduría, Administración, Ciencias de la Comunicación, Matemáticas, Relaciones Internacionales, Economía, Ciencias Políticas y Administración Pública.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Administración y Mercadotecnia, Licenciatura en Enfermería,  Licenciatura en Educación Primaria, Licenciatura en Educación Preescolar, Licenciatura en Nutrición, Licenciatura en Médico Cirujano y Licenciatura en Derecho.'),
(7, 'CIENTÍFICA (CI)', 'Habilidad para la investigación; aptitud para captar, definir y comprender principios y relaciones causales de los fenómenos proponiéndose siempre la obtención de la novedad.', 'Gusto por conocer o investigar la razón de ser de los fenómenos, las causas que los provocan y los principios que los explican.', 'Investigación Biomédica Básica, Ciencias Genómicas, Matemáticas, Física, Ingeniería Mecatrónica, Química, Biología, Medicina Veterinaria y Zootecnia, Ingeniería Química, Química Farmacéutico-Biológica, Química Industrial, Química de Alimentos, Ingeniería en Alimentos, Filosofía, Historia.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Psicología y Licenciatura en Médico Cirujano.'),
(8, 'CÁLCULO (CL)', 'Dominio de las operaciones y mecanizaciones numéricas, así como habilidad para el cálculo matemático.', 'Gusto por resolver problemas de tipo cuantitativo, en donde intervienen las operaciones matemáticas.', 'Matemáticas, Economía, Contaduría, Física, Ingenierías: Geológica, Geofísica, Civil, en Telecomunicaciones, Computación, Topográfica, Industrial, Química; Arquitectura, Geografía, Actuaría, Informática, Química, Matemáticas Aplicadas y Computación, Ciencias de la Comunicación.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Medico Cirujano, Licenciatura en Nutrición, Licenciatura en Educación Primaria y Licenciatura en Administración y Mercadotecnia.'),
(9, 'MECÁNICO CONSTRUCTIVA (MC)', 'Comprensión y habilidad en la manipulación de objetos y facilidad para percibir, imaginar y analizar formas en dos o tres dimensiones, así como para abstraer sistemas, mecanismos y movimientos.', 'Atracción por armar, conocer o descubrir mecanismos por los cuales funciona un aparato, y por proyectar y construir objetos diversos.', 'Ingenierías: Eléctrica-Electrónica, Geofísica, Topográfica, Civil, Petrolera, Mecánica Eléctrica, Química, en Computación, Mecánica Química Metalúrgica, Mecatrónica, Arquitectura, Diseño Industrial.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Fisioterapia y Licenciatura en Médico Cirujano.'),
(10, 'DESTREZA MANUAL (DT)', 'Habilidad en el uso de las manos para el manejo de herramientas; ejecución de movimientos coordinados y precisos.', 'Satisfacción por actividades que se realizan en lugares abiertos, apartados de los conglomerados urbanos.', 'Biología, Ingeniería Agrícola, Ingeniería Geológica, Ingeniería Petrolera, Geografía, Ingeniería Civil, Ingeniería Topográfica y Geodésica, Medicina Veterinaria y Zootecnia, Planificación para el Desarrollo Agropecuario, Urbanismo.\r\n\r\nEL CERT TE OFRECE: Licenciatura en Médico Cirujano, Licenciatura en Fisioterapia y Licenciatura en Enfermería.');
