(38, 8, 'Resolver problemas de álgebra.'),
(39, 9, 'Armar y componer muebles.'),
(40, 10, 'Manejar con habilidad pequeñas piezas y herramientas como agujas, manecillas, joyas, piezas de relojería, etcétera.'),
(41, 1, 'Conversar en las reuniones y fiestas con acierto y naturalidad.'),
(42, 2, 'Dirigir un grupo o equipo en situaciones difíciles o peligrosas.'),
(43, 3, 'Distinguir y apreciar la buena literatura.'),
(44, 4, 'Distinguir y apreciar la buena pintura.'),
(45, 5, 'Distinguir y apreciar la buena música.'),
(46, 6, 'Encargarse de recibir, anotar y dar recados sin olvidar detalles importantes.'),
(47, 7, 'Entender las causas que determinan los acontecimientos históricos.'),
(48, 8, 'Resolver problemas de geometría.'),
(49, 9, 'Aprender el funcionamiento de ciertos mecanismos complicados como motores, relojes, bombas, etcétera.'),
(50, 10, 'Hacer con facilidad trazos geométricos con la ayudad de las escuadras, la regla \"T\" y compás.'),
