(55, 5, 'Dirigir un grupo musical.'),
(56, 6, 'Colaborar en el desarrollo de métodos más eficientes de trabajo.'),
(57, 7, 'Realizar investigaciones científicas teniendo como finalidad la búsqueda de la verdad.'),
